import '../style/TodoListDate.css';

const TodoListDate = () => {

    // 자바스크립트 날짜 데이터 가져오기.
    // new 키워드를 사용하여 Date 객체 가져오기.
    const timeData = new Date();

    const t1 = timeData.toLocaleString();
    const t2 = timeData.toLocaleString('ko-kr');


	return (
        <div className='todolist-date'>
            <h3>{t1}</h3>
            <h4>{t2}</h4>
        </div>
    )
}

export default TodoListDate;
